import React from "react";
import useRssFeed from "../crawlRss";

const NewsHeader: React.FC<{url:string, quantity:number}> = ({url, quantity}) => {
    const rssItems = useRssFeed(url,quantity);
    return (
        <div className={"box-category-middle"}>
            {rssItems.length === 0 ? (
                <p>Đang tải dữ liệu...</p>
            ) : (
                rssItems.map((item, index) => (
                    index > 2 && (
                        <div className="box-category-item">
                            <div className="box-category-content">
                                <h3 className="box-category-title-text">
                                    <a data-type="title"
                                       className="box-category-link-title"
                                       href="/thang-clb-ha-noi-sau-loat-luan-luu-kich-tinh-thanh-hoa-vo-dich-cup-quoc-gia-196240707205539881.htm"
                                       title="Thắng CLB Hà Nội sau loạt luân lưu kịch tính, Thanh Hóa vô địch Cúp Quốc gia">{item.title}</a>
                                </h3>
                            </div>
                        </div>
                    )
                ))
                )}
        </div>
    );
}

export default NewsHeader;
